"use strict";(self.webpackChunkwebsite=self.webpackChunkwebsite||[]).push([[1477],{10:e=>{e.exports=JSON.parse('{"blogPosts":[{"id":"2024-02-21-training-at-dhulikhel-childrens-home","metadata":{"permalink":"/blog/2024-02-21-training-at-dhulikhel-childrens-home","source":"@site/blog/2024-02-21-training-at-dhulikhel-childrens-home/index.md","title":"Training at Dhulikhel Children\'s Home","description":"Training","date":"2024-02-21T00:00:00.000Z","formattedDate":"February 21, 2024","tags":[{"label":"kuosc","permalink":"/blog/tags/kuosc"},{"label":"HeNN","permalink":"/blog/tags/he-nn"},{"label":"LTSP","permalink":"/blog/tags/ltsp"},{"label":"Training","permalink":"/blog/tags/training"}],"readingTime":0.8,"hasTruncateMarker":false,"authors":[{"name":"Aadarsha Dhakal","title":"Coordinator, KUOSC","url":"https://github.com/aadarshadhakalg","imageURL":"https://github.com/aadarshadhakalg.png","key":"aadarshadhakalg"}],"frontMatter":{"slug":"2024-02-21-training-at-dhulikhel-childrens-home","title":"Training at Dhulikhel Children\'s Home","authors":["aadarshadhakalg"],"tags":["kuosc","HeNN","LTSP","Training"]},"nextItem":{"title":"Launch of the KUOSC Website","permalink":"/blog/websitelaunch"}},"content":"![Training](./training.jpg)\\n\\nVolunteers from Kathmandu University Open Source Community (KUOSC) in collaboration with Help Nepal Network Nepal (HeNN) conducted a training session for children at Dhulikhel Children\'s Home. The session focused on equipping the children with essential computer skills and fostering responsible internet usage.\\n\\nThe training aimed to familiarize the children with their newly upgraded computer lab. Volunteers guided them on navigating educational websites like E-Paathsala, E-paath, Maths and Science Quiz, and Hamro Ramailo Kathaharu offered by OLE Nepal. These platforms provide access to a wealth of learning materials, enhancing the children\'s educational opportunities.\\n\\nFurthermore, the volunteers emphasized internet safety, educating the children on responsible online behavior and navigating the digital world with caution.\\n\\n**Volunteers:**\\n- Aadarsha Dhakal\\n- Ayush Paudel\\n- Jamyang Gelek Gurung\\n\\n**From HeNN Nepal:**\\n- Merisha Kafle\\n- Anil Kumar Shrestha\\n\\n\\nThis collaborative effort empowers the children at Dhulikhel Children\'s Home with valuable technological skills and fosters responsible digital citizenship, paving the way for a brighter future."},{"id":"websitelaunch","metadata":{"permalink":"/blog/websitelaunch","source":"@site/blog/2023-08-28-websitelaunch/index.md","title":"Launch of the KUOSC Website","description":"KUOSC Banner","date":"2023-08-28T00:00:00.000Z","formattedDate":"August 28, 2023","tags":[{"label":"kuosc","permalink":"/blog/tags/kuosc"},{"label":"website","permalink":"/blog/tags/website"},{"label":"launch","permalink":"/blog/tags/launch"}],"readingTime":0.91,"hasTruncateMarker":false,"authors":[{"name":"Aadarsha Dhakal","title":"Coordinator, KUOSC","url":"https://github.com/aadarshadhakalg","imageURL":"https://github.com/aadarshadhakalg.png","key":"aadarshadhakalg"}],"frontMatter":{"slug":"websitelaunch","title":"Launch of the KUOSC Website","authors":["aadarshadhakalg"],"tags":["kuosc","website","launch"]},"prevItem":{"title":"Training at Dhulikhel Children\'s Home","permalink":"/blog/2024-02-21-training-at-dhulikhel-childrens-home"}},"content":"![KUOSC Banner](./kuosc-plain-banner.jpeg)\\n\\nIntroducing the New KUOSC Website: Unveiling a Hub of Open Source Activities!\\n\\nThe Kathmandu University Open Source Community (KUOSC) proudly presents its brand-new website! Loaded with features and insights, this platform is set to become the go-to destination for all things related to open source.\\n\\n## What\'s Inside:\\n\\n**Project Showcase:** Dive into the world of open source of KUOSC through detailed project descriptions.Our projects are here to inspire and engage.\\n\\n**Contributors Leaderboard:** Recognizing the dedicated individuals behind our success. The leaderboard highlights top contributors and their valuable contributions.\\n\\n**Knowledge Base:** Whether you\'re a beginner or a seasoned pro, our knowledge base has something for you. Find tutorials, guides, and resources to enhance your skills.\\n\\n**Stay Updated:** Keep track of all KUOSC activities and updates in one place. From events to announcements, you\'ll never miss a beat.\\n\\nJoin us on this exciting journey towards open source innovation. Explore the new KUOSC website today and unlock a world of collaboration and learning. Check it out now at website link!\\n\\nStay tuned for a remarkable open source experience brought to you by KUOSC!"}]}')}}]);